import './App.css';
import { Route } from 'react-router-dom'

import HomePage from './pages/homapage/homePage'
import Shop from './pages/shop/shop'

function App() {
  return (
    <div className="App">
      <Route exact path='/' component={HomePage} />
      <Route path='/shop' component={Shop} />
    </div>
  )
}

export default App;
